import React from "react";

const FeedBack = (props) => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-12 text-center">
          <h1>Feedback from our Students </h1>
        </div>
        <div className="col-12 text-center">
          Read what are students have to say
        </div>
      </div>

      <div className="row">
        <div className="col-12 text-center">
          <h1>Feedback from our Students </h1>
        </div>
      </div>
    </div>
  );
};

export default FeedBack;
